import React from 'react'
import Styles from "./Footer.module.css";
const Footer = () => {
  return (
    
        <div className={Styles.fm}>
        <div className={Styles.fm1}>
            <div></div>
        </div>
        <div className={Styles.fm2}></div>
        <div className={Styles.fm3}></div>

        
        </div>
    
  )
}

export default Footer
